import React from "react";
import Ranked from "./components/Ranked.js"
import { Route} from "react-router-dom";
import SearchBar from "./components/SearchBar";
import Dummy from "./components/dummy";
import Register from "./components/Register"
import Login from "./components/Login"
import Footer from "./components/Footer";



class App extends React.Component{
    constructor(props){
        super(props);
        this.state={
            isLoggedIn:false,
            body:[]
        }
    }

    logIn (){
        this.setState({isLoggedIn:true});
    }

    componentDidMount(){
        fetch("/search")
        .then(res=> res.json())
        .then(body=>{
            this.setState({body});
            console.log(this.state);
        });
    }

    render(){
        return(
            <div>
            <SearchBar searchBody={this.state.body}/>
            <Route exact path = "/ranked" component ={Dummy}/>
            <Route exact path = "/ranked/:item"
            render={
                props=> <Ranked {...props}/>
            }
            />
            <Route exact path = "/registeruser" component = {Register}/>
            <Route exact path = "/loginuser" component = {Login}/>
            <Footer/>
            </div>
        );
    }
}

export default App;
